import React from "react";

const AppReducer = (state: any, action: any) => {
  console.log(state.data);
  switch (action.type) {
    case "PERSONAL_DETAILS":
      const temp = state.data;
      temp.personal_details = action.payload;
      return {
        data: { temp },
      };

    default:
      return state;
  }
};

export default AppReducer;
